import React, { useEffect, useState } from 'react';
import Answer from './Answer';
import 'bootstrap/dist/css/bootstrap.min.css'

function Question({quesNo, quesText, quesType, answerList})
{
    console.log('In Question');
    return(
        <div className='d-flex justify-content-around align-items-start'>
            <div><label className='fw-bold'>{`${quesNo}`}</label></div>
            <div>
                <label className='fw-bold'>{`${quesText}`}</label>

                <ul className='w-100 d-flex justify-content-start list-unstyled'>
                    <li>
                        {answerList.map((element, index)=>(<Answer key = {index} quesType = {quesType} quesNo = {quesNo} ansNo = {element.ansNo} ansText = {element.ansText}/>))}
                    </li>
                </ul>
            </div>
            
        </div>
    );
}

export default Question;
